import React, { useMemo, useState, useEffect } from 'react';

import  ContentHeader  from '../../components/ContentHeader';
import { useParams } from 'react-router-dom';
import  SelectInput  from '../../components/SelectInput';
import MynaMonitoring from '../../components/MynaMonitoring';

import cache_switch_run from '../../repositories/cache_switch_run';
import myna_run from '../../repositories/myna_run';

import { Container, Content, Filters } from './styles';

interface IRouteParams {
    job: string;
}

interface IData {
    status: string;
    date: string;
}

const List: React.FC = () => {

    const [data, setData] = useState<IData>([]);

    const { job } = useParams<keyof IRouteParams>() as IRouteParams;

    const title = useMemo(() => {
        return  job === 'entry-myna' ? 'Myna monitoring': 'Cache switch monitoring'
    }, [job]);

    const lineColor = useMemo(() => {
        return  job === 'entry-myna' ? '#F7931B': '#E44C4E'
    }, [job]);


   const listData = useMemo(() => {
    return  job === 'entry-myna' ? myna_run: cache_switch_run;
    }, [job]);

    const months = [
        {value: 7, label: 'Julho'},
        {value: 8, label: 'Agosto'},
        {value: 9, label: 'Setembro'}
    ];

    const years = [
        {value: 2018, label: 2018},
        {value: 2019, label: 2019},
        {value: 2020, label: 2020}
    ];

    useEffect(() => {
       setData(listData);
    },[]);

    return (
        <Container>
        <ContentHeader title ={title} lineColor={lineColor}>
            <SelectInput options= {months} />
            <SelectInput options= {years} />
        </ContentHeader>

        <Filters>
                <button 
                    type="button"
                    className=
                    {`tag-filter
                    tag-filter-success`}
                >
                    Success
                </button>

                <button 
                    type="button"
                    className= 
                    {`tag-filter
                    tag-filter-failed`
                    }
                >
                    Failed
                </button>
        </Filters>
        <Content>
            <MynaMonitoring 
                tagColor = "#E44C4E"
                title = "Run 01"
                subtitle = "10/10/2024"
                status = "Success"
            />
        </Content>

    </Container>
    );
    }
export default List;
